            setToken(res.data.token);
            commit("SET_TOKEN", res.data.token);
            commit("SET_USER", res.data);
            resolve();
          })
          .catch(error => {
            reject(error);
          });
      });
    },
    // 获取登录用户信息
    GetUser({ commit }) {
      return new Promise((resolve, reject) => {
        getUser()
          .then(res => {
            commit("SET_USER", res.data);
            resolve();
          })
          .catch(error => {
            reject(error);
          });
      });
    },
    // 登出
    Logout({ commit }) {
      removeToken();
      commit("SET_TOKEN", "");
      commit("SET_USER", "");
    }
  },
